import React, { PureComponent } from 'react';
import style from './index.module.scss';

class ItemBox extends PureComponent {
  render() {
    return (
      <section className={`${style['item-box']}`}>
        <div className={`${style['img-box']}`}></div>
      </section>
    );
  }
}

export default ItemBox;
